// src/components/FrontPage.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './FrontPage.css';

function FrontPage() {
  const navigate = useNavigate();

  return (
    <div className="front-page">
      {/* Logo */}
      <header className="header">
        <img src="/logo.png" alt="CSECU Logo" className="logo" />
      </header>

      {/* Welcome Section */}
      <section className="welcome-section">
        <h1 className="welcome-title">Welcome to the CSECU Family üíª</h1>
        <p className="welcome-subtitle">
          Innovating the Future of Computer Science and Engineering
        </p>
      </section>

      {/* Description Section */}
      <section className="description-section">
        <p>
          The Department of Computer Science & Engineering (CSE) at the University of Chittagong launched its undergraduate major programme in 2001 and its postgraduate programme in 2010. 
          CSE department currently hosts 22 faculty members, including eight Professors and around 400 students. 
          There are 300 undergraduate students, 100 MSc students, and a few postgraduate research students in the CSE department, carrying out learning and research activities in a very co-operative and friendly environment. 
          üåê üßë‚Äçüíª üìö
        </p>
      </section>

      {/* Buttons */}
      <div className="button-group">
        <button className="btn primary" onClick={() => navigate('/signup')}>
          Sign Up
        </button>
        <button className="btn secondary" onClick={() => navigate('/login')}>
          Login
        </button>
      </div>
    </div>
  );
}

export default FrontPage;
